import React from "react";

import { CustomInput, Form, FormGroup, Label, Input } from "reactstrap";
import Slider from "@material-ui/core/Slider";

const SidePanel = () => {
  let value = [0, 100];
  return (
    <Form>
      <FormGroup>
        <Label for="exampleCheckbox">Discount Range</Label>
        <div>
          <Slider
            value={value}
            //onChange={handleChange}
            valueLabelDisplay="auto"
            aria-labelledby="range-slider"
            //getAriaValueText={valuetext}
          />
        </div>
      </FormGroup>
      <FormGroup>
        <Label for="exampleAddress">Address</Label>
        <Input
          type="text"
          name="address"
          id="exampleAddress"
          placeholder="1234 Main St"
        />
      </FormGroup>
      <FormGroup>
        <Label for="exampleCheckbox">In Stock</Label>
        <div>
          <CustomInput
            type="switch"
            id="exampleCustomSwitch"
            name="customSwitch"
          />
        </div>
      </FormGroup>

      <FormGroup>
        <Label for="exampleCheckbox">Maufacture Date</Label>
        <div></div>
      </FormGroup>
    </Form>
  );
};

export default SidePanel;
